import React from 'react';
import SidebarOption from '../SidebarOption';
import "./style.css"
const Sidebar = () => {

    return (
        <div className='sidebar plr-10'>
            <img 
            className='sidebar-logo'
            src="https://storage.googleapis.com/pr-newsroom-wp/1/2018/11/Spotify_Logo_CMYK_White.png" alt="" />
            <SidebarOption option="Home"/>
            <SidebarOption option="Search"/>
            <SidebarOption option="Your Library"/>
        </div>
    );
};

export default Sidebar;
